import "./App.css";
import * as dfd from "danfojs";
import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState();

  const getData = async () => {
    try {
      const df = await dfd.readExcel(
        "/Users/omarbailey/Documents/Gym/Omar Random Workout Generator.xlsx"
      );
      setData(df);
    } catch (err) {
      console.log(err);
    }
  };

  useEffect(() => {
    getData();
  }, []);

  data.head().print();

  return (
    <div>
      <h1> Workout Generator</h1>
    </div>
  );
}

export default App;
